import React, { Component } from "react";
import { connect } from "react-redux";
import Dialog from "./Dialog";
import Footer from "./Footer";
import * as quiers from "./../actions/queries";

class Users extends Component {
  componentWillMount() {
    console.log("id", this.prop);
    this.props.getMembers(this.props.userId);
  }

  render() {
    return (
      <div>
        <div className="container">
          <h1>Currently memebers</h1>
          <div class="row">
            <div class="col s6">
              <h4>memeber john</h4>
              <span>date 12/07/19</span>
            </div>
            <div class="col s6">
              <h4>memeber smith</h4>
              <span>date 12/07/19</span>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

Users.propTypes = {};

function mapDispatchToProps(dispatch) {
  return {
    getMembers: () => dispatch(quiers.getMembers())
  };
}

// export default Users;

function mapStateToProps(state) {
  return {
    userId: state.user.profile
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Users);
